package models_test

import (
	"github.com/lab259/go-thoth/test/models"
	. "github.com/onsi/ginkgo"
	. "github.com/onsi/gomega"
)

var _ = Describe("DataURI", func() {

	var (
		s     = "data:image/png;base64,"
		slice = []string{s}
	)

	It("should empty validation", func() {
		m := models.DataURIValidate{
			DataURI: s,
			Pointer: &s,
			Slice:   slice,
		}

		errs := m.Validate()
		Expect(errs).To(HaveLen(0))
	})

	It("should fail validate datauri when datauri invalid", func() {
		ss := "invalid-datauri"
		m := models.DataURIValidate{
			DataURI: s,
			Pointer: &ss,
		}

		errs := m.Validate()
		Expect(errs).To(HaveLen(1))
		Expect(errs[0].Field()).To(Equal("Pointer"))
		Expect(errs[0].Tag()).To(Equal("datauri"))
	})

	It("should fail validate datauri when Slice datauri is invalid", func() {
		m := models.DataURIValidate{
			DataURI: s,
			Pointer: &s,
			Slice: []string{
				s,
				"invalid-datauri",
			},
		}

		errs := m.Validate()
		Expect(errs).To(HaveLen(1))
		Expect(errs[0].Field()).To(Equal("Slice"))
		Expect(errs[0].Tag()).To(Equal("datauri"))
	})

	It("should fail to validate without field `DataURI`", func() {
		m := models.DataURIValidate{
			// DataURI: s,
			Pointer: &s,
		}

		errs := m.Validate()
		Expect(errs).To(HaveLen(1))
		Expect(errs[0].Field()).To(Equal("DataURI"))
		Expect(errs[0].Tag()).To(Equal("datauri"))
	})

	It("should fail to validater without field `Pointer`", func() {
		m := models.DataURIValidate{
			DataURI: s,
			// Pointer: &s,
		}

		errs := m.Validate()
		Expect(errs).To(HaveLen(1))
		Expect(errs[0].Field()).To(Equal("Pointer"))
		Expect(errs[0].Tag()).To(Equal("datauri"))
	})

})
